import React from 'react';

interface FrogMarketplaceCardProps {
    listing: any;
    purchaseOrdinal: (outpoint: string, rate: number, address: string) => void;
    exchangeRate: number;
}

const FrogMarketplaceCard: React.FC<FrogMarketplaceCardProps> = ({ listing, purchaseOrdinal, exchangeRate }) => {
    // Assuming `ordinal` is the data for the Frog ordinal
    const {
        data: {
            list: { price },
        },
        origin: {
            data: {
                insc: { file },
            },
        },
        owner,
    } = listing;

    const imageURL = `https://v3.ordinals.gorillapool.io/api/${file.hash}`;

    return (
        <div className="ordinal-card">
            <img src={imageURL} alt="Frog Ordinal" />
            <div className="ordinal-details">
                <h3>Frog #{listing.origin.data.subTypeData.mintNumber}</h3>
                <p>Owner: {owner}</p>
                <p>Price: {price} BSV</p>
            </div>
        </div>
    );
};

export default FrogMarketplaceCard;
